import './UserData.css';
import SpecificUSerData from './SpecificUserData';
// import React, { useState } from 'react';


function UserData(props) {
    // console.log(props);

    return (
        <div>

            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Role</th>

                    </tr>
                </thead>
                {props.items.map((user) => (


                    <SpecificUSerData
                        key={user.id}
                        name={user.name}
                        email={user.email}
                        role={user.role}
                    />

                ))}
            </table>

        </div>
    );
}

export default UserData;
